import React from "react";

const Popup = ({ isOpen, value, onChange, onSave, onClose }) => {
  if (!isOpen) return null;

  return (
    <div
      style={{
        position: "fixed",
        top: "50%",
        left: "50%",
        transform: "translate(-50%, -50%)",
        background: "white",
        border: "1px solid black",
        padding: "20px",
        zIndex: 1000,
      }}
    >
      <h3>Edit Label</h3>
      <textarea rows="5" cols="40" value={value} onChange={onChange} />
      <br />
      <button onClick={onSave}>Save</button>
      <button onClick={onClose} style={{ marginLeft: "10px" }}>
        Cancel
      </button>
    </div>
  );
};

export default Popup;
